pub unconstrained fn emit_contract_class_unencrypted_log_private<let N: u32>(
    contract_address: AztecAddress,
    message: [Field; N],
    counter: u32,
) -> Field {
    emit_contract_class_unencrypted_log_private_oracle(contract_address, message, counter)
}

